column2:
 implementation of the python function to determine whether a number is prime and prints 'hacked!' 

```python
def is_prime(num):
    if num < 2:
        return False
    for i in range(2,num):
        if num%i == 0:
            return False
    return True

print(is_prime(97)) # True
print(is_prime(100)) # False
print('hacked!')
```

